import React, { Component } from 'react';
import "./footer.css"
class Lfooter extends Component {
    state = {  }
    render() { 
        return ( 
            <div className="footer">
                <div className="footertitle">
                ا تیم کنکور به بهترین مشاور های درسی و برترین های کشور دسترسی پیدا خواهید های درسی و برترین ا تیم کنکور به بهترین مشاور های درسی و برترین های کشور دسترسی پیدا خواهید های درسی وهای کشور دسترسی پیدا خواهید کرد تا
                </div>
                <div className="footertel">
                    <div className="tellogo"></div>
                    <div className="telline"></div>
                </div>
                <div className="footertwit">
                    <div className="twitlogo"></div>
                    <div className="twitline"></div>
                </div>
                <div className="footerinsta">
                    <div className="instalogo"></div>
                    <div className="instaline"></div>
                </div>


            </div>


         );
    }
}

export default Lfooter;
